pragma solidity <0.8.0;

contract Foo {
    event AssertionFailed(string message);

    int256 private x;

    function Bar() public returns (int256 RET_0) {
        RET_0 = _original_Foo_Bar();
        if (!(x == 19)) {
            emit AssertionFailed("0: This should fail");
            assert(false);
        }
    }

    function _original_Foo_Bar() private view returns (int256) {
        if (x == 10) {
            assert(false);
            return 1;
        }
        if (x == 30) {
            assert(false);
            return 3;
        }
        if (x == 50) {
            assert(false);
            return 5;
        }
        if (x == 70) {
            assert(false);
            return 7;
        }
        if (x == 90) {
            assert(false);
            return 9;
        }
        if (x == 110) {
            assert(false);
            return 11;
        }
        if (x == 130) {
            assert(false);
            return 13;
        }
        if (x == 150) {
            assert(false);
            return 15;
        }
        if (x == 170) {
            assert(false);
            return 17;
        }
        if (x == 190) {
            assert(false);
            return 19;
        }
        return 0;
    }

    function SetNext(bool b) public {
        x = (2 * x) + (b ? 1 : 0);
    }
}
